export default {
  audioWave: {
    light: require('./audio_waveform_light.png'),
    dark: require('./audio_waveform_dark.png'),
  },
  sun: require('./sun.png'),
  moon: require('./moon.png'),
  player: {
    light: require('./player_light.png'),
    dark: require('./player_dark.png'),
  },
  messages: {
    light: require('./messages_light.png'),
    dark: require('./messages_dark.png'),
  },
  menu: {
    light: require('./menu_light.png'),
    dark: require('./menu_dark.png'),
  },
  heart: {
    light: require('./heart_light.png'),
    dark: require('./heart_dark.png'),
  },
  discover: {
    light: require('./discover_light.png'),
    dark: require('./discover_dark.png'),
  },
  discoverLegacy: {
    light: require('./discover_light_legacy.png'),
    dark: require('./discover_dark_legacy.png'),
  },
};

